import React from 'react'
import kulaklik from "../logo/kulaklik.jpg"

export const SomeDatax = [
    {
        title:"Kulaklık",
        link: "/Kulaklik",
        icon: <img alt="" style={{height:"100px",width:"100px"}} src={kulaklik}></img>
    },
    {
        title:"Oyuncu Koltugu",
        link: "/Oyuncu_Koltugu"
    },
    {
        title:"Bilgisayar",
        link: "/Bilgisayar"
    },
    {
        title:"Araba",
        link: "/Araba"
    },
    {
        title:"Uçak",
        link: "/Ucak"
    },
    {
        title:"S400",
        link: "/S400"
    },
]
